import logo from "./logo.svg";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Expenses from "./components/Expenses";
import NewEpenses from "./components/addNewEpenses/NewEpenses";

function App() {
  const date = new Date("October, 13, 2022");
  const expense = [
    { id: 1, title: "panana", prise: "34.9$", date: date },
    { id: 2, title: "apple", prise: "22.9$", date: date },
    { id: 3, title: "car", prise: "209093.9$", date: date },
    { id: 4, title: "pen", prise: "13.9$", date: date },
  ];

  return (
    <div>
      <NewEpenses />
      <Expenses data={expense} />;
    </div>
  );
}

export default App;
